-- ----------------------------
-- Table structure for ep_crontab_log
-- ----------------------------
DROP TABLE IF EXISTS `ep_crontab_log`;
CREATE TABLE `ep_crontab_log`  (
  `id` int UNSIGNED NOT NULL AUTO_INCREMENT,
  `crontab_id` int NULL DEFAULT NULL COMMENT '任务ID',
  `executetime` bigint NULL DEFAULT NULL COMMENT '执行时间',
  `completetime` bigint NULL DEFAULT NULL COMMENT '结束时间',
  `content` text CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL COMMENT '执行结果',
  `processid` int NULL DEFAULT 0 COMMENT '进程ID',
  `status` enum('success','failure','inprogress') CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT 'failure' COMMENT '状态',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `crontab_id`(`crontab_id` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb3 COLLATE = utf8mb3_general_ci COMMENT = '定时任务日志表' ROW_FORMAT = Dynamic;

