-- ----------------------------
-- Table structure for ep_order
-- ----------------------------
DROP TABLE IF EXISTS `ep_order`;
CREATE TABLE `ep_order`  (
  `id` int NOT NULL AUTO_INCREMENT,
  `merchant_id` int NOT NULL DEFAULT 0 COMMENT '商户号',
  `orderno` varchar(64) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '商户订单号',
  `sys_orderno` varchar(32) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '系统订单号',
  `up_orderno` varchar(64) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '上游订单号',
  `total_money` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '订单金额',
  `have_money` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '获得金额',
  `agent_money` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '代理金额',
  `upstream_money` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '上游扣费金额',
  `name` varchar(32) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT '姓名',
  `email` varchar(64) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT '邮件',
  `utr` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '00000000' COMMENT '流水号',
  `phone` bigint NOT NULL COMMENT '手机号',
