  `style` enum('0','1') CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '0' COMMENT '订单类型:0=普通订单,1=充值订单',
  `status` enum('0','1','2') CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '0' COMMENT '订单状态:0=未支付,1=支付成功,2=扣量订单',
  `notify_status` enum('0','1','2') CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '0' COMMENT '通知状态:0=未通知,1=通知成功,2=通知失败',
  `notify_count` tinyint NOT NULL DEFAULT 0 COMMENT '通知次数',
  `rate` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '订单费率',
  `channel_rate` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '通道费率',
  `upstream_rate` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '上游费率',
  `api_upstream_id` int NOT NULL DEFAULT 0 COMMENT '上游类型编号',
  `api_account_id` int NOT NULL DEFAULT 0 COMMENT '接口账号编号',
  `api_type_id` int NOT NULL DEFAULT 0 COMMENT '接口类型编号',
  `req_info` text CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT '请求信息',
  `createtime` int NOT NULL DEFAULT 0 COMMENT '添加时间',
  `paytime` int NOT NULL DEFAULT 0 COMMENT '支付时间',
  `repair` tinyint NOT NULL DEFAULT 0 COMMENT '是否补单:0=未补单,1=补单',
  `repair_admin_id` int NOT NULL DEFAULT 0 COMMENT '补单会员id',
  `repair_time` int NOT NULL DEFAULT 0 COMMENT '补单时间',
  `req_ip` varchar(128) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '拉起订单的ip地址',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `idx_orderno`(`orderno` ASC) USING BTREE,
  UNIQUE INDEX `idx_sys_orderno`(`sys_orderno` ASC) USING BTREE,
  INDEX `idx_createtime`(`createtime` ASC) USING BTREE,
  INDEX `idx_repair_time`(`repair_time` ASC) USING BTREE,
  INDEX `idx_up_orderno`(`up_orderno` ASC) USING BTREE,
  INDEX `idx_merchant`(`merchant_id` ASC, `status` ASC, `createtime` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 30 CHARACTER SET = utf8mb3 COLLATE = utf8mb3_general_ci COMMENT = '订单表' ROW_FORMAT = Dynamic;

