DROP TABLE IF EXISTS `ep_repay_notifylog`;
CREATE TABLE `ep_repay_notifylog`  (
  `id` int NOT NULL AUTO_INCREMENT,
  `order_id` int NOT NULL DEFAULT 0 COMMENT '订单id',
  `notifyurl` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '通知地址',
  `data` text CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT '发送报文',
  `result` longtext CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT '响应值',
  `createtime` int NOT NULL DEFAULT 0 COMMENT '添加时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_orderid`(`order_id` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 19 CHARACTER SET = utf8mb3 COLLATE = utf8mb3_general_ci COMMENT = 'api代付通知记录' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of ep_repay_notifylog
-- ----------------------------

-- ----------------------------
-- Table structure for ep_repay_order
-- ----------------------------
DROP TABLE IF EXISTS `ep_repay_order`;
CREATE TABLE `ep_repay_order`  (
  `id` int NOT NULL AUTO_INCREMENT,
  `merchant_id` int NOT NULL DEFAULT 0 COMMENT '商户号',
  `orderno` varchar(64) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '订单号',
  `style` enum('0','1') CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '0' COMMENT '提现类型:0=后台申请,1=API代付',
  `money` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '提款金额',
  `account` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '银行卡账号',
  `name` varchar(30) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '真实姓名',
  `phone` varchar(15) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT '手机号',
  `email` varchar(64) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '邮箱地址',
  `bank_code` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '代付方式编码',
  `notifyUrl` varchar(20) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '通知地址',
  `status` enum('0','1','2','3','4') CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '0' COMMENT '订单状态:0=申请中,1=已支付,2=冻结,3=取消,4=失败',
  `daifustatus` enum('0','1','2','3','4') CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '0' COMMENT '代付状态:0=未提交,1=已提交,2=失败,3=成功,4=驳回',
  `charge` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '手续费',
  `upcharge` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '上游手续费',
  `msg` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT '代付消息\r\n',
  `bankname` varchar(65) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT '银行名',
  `utr` varchar(30) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '00000000' COMMENT '流水号',
  `bic` varchar(13) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '银行码',
  `notify_status` enum('0','1','2') CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '0' COMMENT '通知状态:0=未通知,1=通知成功,2=通知失败',
  `notify_count` tinyint NOT NULL DEFAULT 0 COMMENT '通知次数',
  `req_info` text CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT '请求信息',
  `req_ip` varchar(30) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '申请ip',
  `createtime` int NOT NULL DEFAULT 0 COMMENT '添加时间',
  `paytime` int NULL DEFAULT NULL COMMENT '支付时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `idx_orderno`(`orderno` ASC) USING BTREE,
  INDEX `idx_merchantid`(`merchant_id` ASC, `createtime` ASC) USING BTREE,
  INDEX `idx_createtime`(`createtime` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 10 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '代付订单' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of ep_repay_order
-- ----------------------------

-- ----------------------------
-- Table structure for ep_repay_settle
-- ----------------------------
DROP TABLE IF EXISTS `ep_repay_settle`;
CREATE TABLE `ep_repay_settle`  (
  `id` int NOT NULL AUTO_INCREMENT,
  `merchant_id` int NOT NULL DEFAULT 0 COMMENT '商户号',
  `orderno` varchar(64) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '订单号',
