  `apply_style` enum('0','1') CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT '1' COMMENT '申请类型:0=商户后台,1=系统后台',
  `money` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '结算金额',
  `charge` decimal(10, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '手续费',
  `caraddresstype` enum('TRC20','ERC20','-') CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT 'usdt类型',
  `caraddress` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT 'usdt地址',
  `usdt_rate` decimal(10, 2) NOT NULL COMMENT 'usdt汇率',
  `usdt` decimal(10, 4) NULL DEFAULT NULL COMMENT 'usdt',
  `msg` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT '结算消息',
  `image` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '转账截图',
  `status` enum('0','1','2') CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '0' COMMENT '订单状态:0=审核中,1=已支付,2=取消',
  `account` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '银行卡账号',
  `name` varchar(30) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '真实姓名',
  `phone` varchar(15) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT '手机号',
  `email` varchar(64) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '邮箱地址',
  `bankname` varchar(65) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT '银行名',
  `bic` varchar(13) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '银行码',
  `utr` varchar(30) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '00000000' COMMENT 'utr',
  `req_info` text CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT '请求信息',
  `req_ip` varchar(30) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '申请ip',
  `createtime` int NOT NULL DEFAULT 0 COMMENT '添加时间',
  `paytime` int NULL DEFAULT NULL COMMENT '支付时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `idx_orderno`(`orderno` ASC) USING BTREE,
  INDEX `idx_merchantid`(`merchant_id` ASC, `createtime` ASC) USING BTREE,
  INDEX `idx_createtime`(`createtime` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 6 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '结算账单' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of ep_repay_settle
-- ----------------------------

-- ----------------------------
-- Table structure for ep_repay_uporder
-- ----------------------------
DROP TABLE IF EXISTS `ep_repay_uporder`;
CREATE TABLE `ep_repay_uporder`  (
  `id` int NOT NULL AUTO_INCREMENT,
  `pay_id` int NOT NULL DEFAULT 0 COMMENT '代付账单id',
  `status` enum('0','1','2','3') CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '0' COMMENT '状态:0=发起支付,1=支付成功,2=支付失败,3=驳回',
  `orderno` varchar(64) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '订单号',
  `api_account_id` int NOT NULL DEFAULT 0 COMMENT '代付账户id',
  `outorderno` varchar(64) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '上游单号',
  `outdesc` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '上游描述',
  `paytime` int NOT NULL DEFAULT 0 COMMENT '代付时间',
  `createtime` int NOT NULL DEFAULT 0 COMMENT '添加时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `idx_orderno`(`orderno` ASC) USING BTREE,
  INDEX `idx_payid`(`pay_id` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 15 CHARACTER SET = utf8mb3 COLLATE = utf8mb3_general_ci COMMENT = '上游代付订单' ROW_FORMAT = Dynamic;

