DROP TABLE IF EXISTS `ep_user_log`;
CREATE TABLE `ep_user_log`  (
  `id` int NOT NULL AUTO_INCREMENT,
  `merchantid` int NOT NULL DEFAULT 0 COMMENT '商户号',
  `content` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '内容',
  `module` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT '模块',
  `request` text CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT '请求信息',
  `ip` varchar(24) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL DEFAULT '' COMMENT 'ip地址',
  `createtime` int NOT NULL DEFAULT 0 COMMENT '添加时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_merid_time_module`(`merchantid` ASC, `createtime` ASC, `module` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 26 CHARACTER SET = utf8mb3 COLLATE = utf8mb3_general_ci COMMENT = '用户操作日志记录表' ROW_FORMAT = Dynamic;

